import { View, Text } from "react-native";
import React from "react";
import { useStateContext } from "../Context/Cart_context";

const Carrinho = (props) => {
  const { onAdd } = useStateContext();
  return (
    <View>
      <Text>Carrinho</Text>
    </View>
  );
};

export default Carrinho;
